import React from 'react'

function Images(props) {
    return (
        <img src={props.imgsrc} alt="mypic" className="card_img" />
    )
}
function Title(props) {
    return (
        <span className="Card_category">
            {props.title}
        </span>
    )
}
export default Images;
export { Title };
